import './Relatorio.css';
import '../AdmGlobal.css'
import NavAdm from '../../../Component/NavAdm/NavAdm'
import { useEffect, useState } from 'react'


function RelatorioAdm() {

  //const baseUrl = "http://34.28.64.143:8080"
    const baseUrl = "http://localhost:8080"
    const[seletor, setSeletor] = useState('')
    const[diaReferencia, setDiaReferencia] = useState('')
    const[mesReferencia, setMesReferencia] = useState('')
    const[anoReferencia, setAnoReferencia] = useState('')
    const [relatorioDiadio, setrelatorioDiadio] = useState({
        diaReferencia: '', 
        valorVendidoDinheiro: '',
        valorVendidoPix: '',
        valorVendidoCredito: '',
        valorVendidoDebito: '',
        valorTotalVenda: ''
    });
    const [relatorioMensal, setrelatorioMensal] = useState({
        mesReferencia: '', 
        dataAbertura: '',
        valorVendidoDinheiro: '',
        valorVendidoPix: '',
        valorVendidoCredito: '',
        valorVendidoDebito: '',
        valorTotalVenda: '',
        dataFechamento: ''
    });
    const [relatorioAnual, setrelatorioAnual] = useState({
        anoReferencia: '', 
        valorVendidoDinheiro: '',
        valorVendidoPix: '',
        valorVendidoCredito: '',
        valorVendidoDebito: '',
        valorTotalVenda: ''
    });
    useEffect(()=>{
        fetch(`${baseUrl}/realtorio/BuscarRelatorioPorDia`, 
            {
                method:'GET',
                headers:{
                    'content-type': 'application/json',
                },
            })
            .then((resp)=> resp.json())
            .then((data)=> {
                setrelatorioDiadio(data)
            })
            .catch(err => console.log(err))
    }, [])

    useEffect(()=>{
        fetch(`${baseUrl}/realtorio/BuscarRelatorioPorMes`, 
            {
                method:'GET',
                headers:{
                    'content-type': 'application/json',
                },
            })
            .then((resp)=> resp.json())
            .then((data)=> {
                setrelatorioMensal(data)
            })
            .catch(err => console.log(err))
    }, [])

    useEffect(()=>{
        fetch(`${baseUrl}/realtorio/BuscarRelatorioPorAno`, 
            {
                method:'GET',
                headers:{
                    'content-type': 'application/json',
                },
            })
            .then((resp)=> resp.json())
            .then((data)=> {
                setrelatorioAnual(data)
            })
            .catch(err => console.log(err))
    }, [])

    const buscarRelatorioDiario=async (e)=>{
        try{
            await fetch(`${baseUrl}/realtorio/BuscarRelatorioPordiaReferencia?diaReferencia=${diaReferencia}`, 
            {
                method:'GET',
                headers:{
                    'content-type': 'application/json',
                },
            })
            .then((resp)=> resp.json())
            .then((data)=> {
                setrelatorioDiadio(data)
            })
        }catch (err){
          console.log("erro")
        }
      }

      const buscarRelatorioMensal=async (e)=>{
        try{
             await fetch(`${baseUrl}/realtorio/BuscarRelatorioPorMesReferencia?mesReferencia=${mesReferencia}`, 
                {
                    method:'GET',
                    headers:{
                        'content-type': 'application/json',
                    },
                })
                .then((resp)=> resp.json())
                .then((data)=> {
                    setrelatorioMensal(data)
                })
        }catch (err){
          console.log("erro")
        }
      }

      const buscarRelatorioAnual=async (e)=>{
        try{
            await fetch(`${baseUrl}/realtorio/BuscarRelatorioPorAnoReferencia?anoReferencia=${anoReferencia}`, 
                {
                    method:'GET',
                    headers:{
                        'content-type': 'application/json',
                    },
                })
                .then((resp)=> resp.json())
                .then((data)=> {
                    setrelatorioAnual(data)
                })
        }catch (err){
          console.log("erro")
        }
      }


    return(
        <>
            <div className="admBoxGeral">
                
                <div className="admBoxNav">
                    <NavAdm></NavAdm>
                </div>

                <div className="admSession">

                    <div className='relatorioBlocoGeral'>
                        <div className='seletor'>
                            <input type='radio' value="dia" onClick={(e)=>{setSeletor(e.target.value)}} />Diario
                            <input type='radio' value="mensal" onClick={(e)=>{setSeletor(e.target.value)}} />Mensal
                            <input type='radio' value="anual" onClick={(e)=>{setSeletor(e.target.value)}} />Anual
                            <br/><br/>
                            {seletor.length === 3?(<>
                                <form>
                                    <fieldset>
                                        <input 
                                        type='number' 
                                        name="diaRelatorio" 
                                        placeholder='digite o dia a ser pesquisado'
                                        onChange={(e)=>{setDiaReferencia(e.target.value)}}
                                        />
                                        <input type='submit' value="Buscar"/>
                                    </fieldset>
                                </form>
                                <div className='retornoInfoRelatorio'>
                                    <h1>RELATÓRIO DE VENDAS</h1>
                                    <p>Dia: {relatorioDiadio.diaReferencia}</p>
                                    <p>Total de vendas no Débito: {relatorioDiadio.valorVendidoDebito} </p>
                                    <p>Total de vendas no Credito: {relatorioDiadio.valorVendidoCredito}</p>
                                    <p>Total de vendas no Dinheiro: {relatorioDiadio.valorVendidoDinheiro}</p>
                                    <p>Total de vendas no Pix: {relatorioDiadio.valorVendidoPix}</p>
                                    <p>Valor Total: {relatorioDiadio.valorTotalVenda}</p>
                                </div>
                            </>):(<></>)}
                            {seletor.length === 6?(<>
                                <form>
                                    <fieldset>
                                        <input 
                                        type='number' 
                                        name="mesRelatorio" 
                                        placeholder='digite o mês a ser pesquisado' 
                                        onChange={(e)=>{setMesReferencia(e.target.value)}}
                                        />
                                        <input type='submit' value="Buscar"/>
                                    </fieldset>
                                </form>
                                <div className='retornoInfoRelatorio'>
                                    <h1>RELATÓRIO DE VENDAS</h1>
                                    <p>Data de Abertura de Relatório mensal: {relatorioMensal.dataAbertura}</p>
                                    <p>Total de vendas no Débito: {relatorioMensal.valorVendidoDebito}</p>
                                    <p>Total de vendas no Credito: {relatorioMensal.valorVendidoCredito}</p>
                                    <p>Total de vendas no Dinheiro: {relatorioMensal.valorVendidoDinheiro}</p>
                                    <p>Total de vendas no Pix: {relatorioMensal.valorVendidoPix}</p>
                                    <p>Total de vendas Mensal: {relatorioMensal.valorTotalVenda}</p>
                                    <p>Data de Fechamento de Relatório mensal: {relatorioMensal.dataFechamento}</p>
                                </div>
                            </>):(<></>)}
                            {seletor.length === 5?(<>
                                <form>
                                    <fieldset>
                                        <input 
                                        type='number' 
                                        name="anoRelatorio" 
                                        placeholder='digite o ano a ser pesquisado'
                                        onChange={(e)=>{setAnoReferencia(e.target.value)}}
                                        />
                                        <input type='submit' value="Buscar"/>
                                    </fieldset>
                                </form>
                                <div className='retornoInfoRelatorio'>
                                    <h1>RELATÓRIO DE VENDAS</h1>
